Information
------------------------------

Birthplace of the Giants
Birthplace of the Giants is an epic scientific expedition where intrepid whale researchers Curt and Micheline Jenner travel to the remote humpback whale breeding grounds in the Kimberley of Western Australia. 
Using the latest aerial camera drones and night vision technology they capture never seen before footage and provide an impassioned insight into the secret life of the enigmatic humpback whale.
Aboard their stealth research vessel Curt and Micheline find themselves amongst a group of fighting male humpback whales engaged in a colossal battle that goes deep into the night.
In a scientific first the team makes a one in a million discovery of a whale that had been rescued from drowning almost two years ago - a fitting finale to this landmark film that exposes the incredible world of the Birthplace Of The Giants.

